import React from 'react';
import './AboutMe.css'

function AboutMe() {
    return (
        <div className="about-me-page">
             <h1>Welcome to the About Me page</h1>
            <img id="about-image" src={require("./about-pic.png")}/>
            <div className="indeed"></div>
        </div>
    )
}

export default AboutMe
